const Button = ({ type, variant, className, id, onClick, childre }) => {
  return (
    <button
      type={type ? type : 'button'}
      variant={variant}
      className={className ? `btn-component ${className}` : 'btn-component'}
      id={id}
      onClick={onClick}
    >
      {Children}
    </button>
  );
};

export default Button;
